import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Navbar from './Components/Navbar/Navbar';
import TechnicianLocation from './Components/TechnicianLocation/TechnicianLocation';

import Home from './Pages/Home/Home';
import Category from './Pages/Category/Category';
import Internet_IT from './Pages/Internet_IT/Internet';
import MyApplication from './Pages/My-Application/MyApps';
import Shifts from './Pages/Shifts/Shifts';
import InternetStatus from './Pages/InternetStatus/InternetStatus';
import Chat from './Pages/Chats/Chats';
import Login from './Pages/Login/Login';
import Signup from './Pages/Signup/Signup';
import TechnicianProfile from './Protected_Apps/TechnicianProfile/TechnicianProfile';
import TechnicianTickets from './Protected_Apps/Tickets/TechnicianTickets';
import ClientProfile from './Protected_Apps/ClientProfile/ClientProfile';
import TechCategoryProfile from './Pages/TechCategoryProfile/TechCategoryProfile';

function App() {
    const [isAuthenticated, setIsAuthenticated] = useState(false);
    const [user, setUser] = useState(null);
    const [loading, setLoading] = useState(true);

    // Check if user is logged in on app start
    useEffect(() => {
        const checkAuthStatus = () => {
            const token = localStorage.getItem('token');
            const userData = localStorage.getItem('user');

            if (token && userData) {
                try {
                    const parsedUser = JSON.parse(userData);
                    setIsAuthenticated(true);
                    setUser(parsedUser);
                    console.log('User restored from localStorage:', parsedUser);
                } catch (error) {
                    console.error('Error parsing user data:', error);
                    localStorage.removeItem('token');
                    localStorage.removeItem('user');
                }
            }
            setLoading(false);
        };

        checkAuthStatus();
    }, []);

    const handleLogin = (userData) => {
        setIsAuthenticated(true);
        setUser(userData);
        console.log('User logged in:', userData);
    };

    const handleLogout = () => {
        setIsAuthenticated(false);
        setUser(null);
        localStorage.removeItem('token');
        localStorage.removeItem('user');
        console.log('User logged out');
    };

    // Show loading spinner while checking authentication
    if (loading) {
        return (
            <div className="loading-container">
                <div className="loading-spinner">Loading...</div>
            </div>
        );
    }

    return (
        <Router>
            <Navbar 
                isAuthenticated={isAuthenticated} 
                user={user}
                onLogout={handleLogout} 
            />
            <Routes>
                {/* Public Routes */}
                <Route path="/" element={<Home />} />
                <Route path="/category" element={<Category />} />
                <Route path="/category/internet" element={<Internet_IT />} />
                <Route path="/nearbytechnician" element={<TechnicianLocation />} />
                <Route path="/shifts" element={<Shifts />} />
                <Route path="/internet-status" element={<InternetStatus />} />
                <Route path="/chat" element={<Chat />} />

                {/* Authentication Routes */}
                <Route 
                    path="/login" 
                    element={
                        !isAuthenticated ? (
                            <Login onLogin={handleLogin} />
                        ) : (
                            <Navigate to={
                                user?.userType === 'technician' 
                                    ? `/techniciancategoryprofile/${user.id || user._id}` 
                                    : '/client-profile'
                            } />
                        )
                    } 
                />

                <Route 
                    path="/signup" 
                    element={
                        !isAuthenticated ? (
                            <Signup onLogin={handleLogin} />
                        ) : (
                            <Navigate to={
                                user?.userType === 'technician' 
                                    ? `/techniciancategoryprofile/${user.id || user._id}` 
                                    : '/client-profile'
                            } />
                        )
                    } 
                />

                {/* Protected Routes */}
                <Route 
                    path="/my-application" 
                    element={
                        isAuthenticated ? (
                            <MyApplication user={user} />
                        ) : (
                            <Navigate to="/login" />
                        )
                    } 
                />

                <Route 
                    path="/my-application/tickets" 
                    element={
                        isAuthenticated ? (
                            <TechnicianTickets user={user} />
                        ) : (
                            <Navigate to="/login" />
                        )
                    } 
                />

                {/* Technician Profile Routes */}
                <Route 
                    path="/techniciancategoryprofile/:id" 
                    element={<TechCategoryProfile user={user} />} 
                />

                <Route 
                    path="/technician-profile" 
                    element={
                        isAuthenticated && user?.userType === 'technician' ? (
                            <TechnicianProfile user={user} />
                        ) : isAuthenticated ? (
                            <Navigate to="/client-profile" />
                        ) : (
                            <Navigate to="/login" />
                        )
                    } 
                />

                {/* Client Profile Route */}
                <Route 
                    path="/client-profile" 
                    element={
                        isAuthenticated && user?.userType === 'client' ? (
                            <ClientProfile user={user} />
                        ) : isAuthenticated ? (
                            <Navigate to={`/techniciancategoryprofile/${user?.id || user?._id}`} />
                        ) : (
                            <Navigate to="/login" />
                        )
                    } 
                />

                {/* Redirect authenticated users away from home to their respective profiles */}
                <Route 
                    path="/home" 
                    element={
                        isAuthenticated ? (
                            <Navigate to={
                                user?.userType === 'technician' 
                                    ? `/techniciancategoryprofile/${user.id || user._id}` 
                                    : '/client-profile'
                            } />
                        ) : (
                            <Home />
                        )
                    } 
                />

                {/* 404 Route */}
                <Route path="*" element={<div>Page not found</div>} />
            </Routes>
        </Router>
    );
}

export default App;
